import React, { Suspense, Lazy } from 'react';
import GridLoader from 'react-spinners/GridLoader';
const PhotoList = Lazy(() => import('./PhotoList'));

const Photo = ({ images }) => {
	return (
		<div>
			<Suspense fallback={'loading'}>
				<PhotoList images={images} />
			</Suspense>
		</div>
	);
};

export default Photo;
